import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Card } from "react-bootstrap";

const API_URL = "http://localhost:5009/api/company";
const CardObject = ({ objectData, companyId, identifiers }) => {
  const [objectCards, setObjectCards] = useState([]);

  useEffect(() => {
    const fetchObjectCards = async () => {
      try {
        const response = await axios.post(`${API_URL}/getObjCards`, {
          companyId,
          identifiers,
        });
        setObjectCards(response.data);
      } catch (error) {
        console.log('Ошибка при получении карточек объектов:', error);
      }
    };

    fetchObjectCards();
  }, [companyId, identifiers]);
  return (
    <Card border="primary" style={{ margin: 10}}>
      <Card.Body>
        <Card.Header>{objectData.name}</Card.Header>
        <Card.Text>
          <p className="mb-1">Регистрационный номер: {objectData.registry_number}</p>
          <p className="mb-1">Date Entry: {objectData.date_entry}</p>
          <p className="mb-1">Kind Object: {objectData.kind_object}</p>
          <p className="mb-1">Тип объекта: {objectData.type_object}</p>
          <p className="mb-1">Адрес: {objectData.address}</p>
          <p className="mb-1">Субъект РФ: {objectData.subject_rf}</p>
          <p className="mb-1">Settlement: {objectData.settlement}</p>
          <p className="mb-1">Index: {objectData.index}</p>
          <p className="mb-1">Basis Inclusion: {objectData.basis_inclusion}</p>
          <p className="mb-1">Date Categorization: {objectData.date_categorization}</p>
          <p className="mb-1">Category: {objectData.category}</p>
          <p className="mb-1">Basis Changes: {objectData.basis_changes}</p>
          <p className="mb-1">Date Changes: {objectData.date_changes}</p>
          <p className="mb-1">Date Changes Category: {objectData.date_changes_category}</p>
          <p className="mb-1">Category Changes: {objectData.category_changes}</p>
          <p className="mb-1">Basis Removal: {objectData.basis_removal}</p>
          <p className="mb-1">Date Removal: {objectData.date_removal}</p>
        </Card.Text>
      </Card.Body>
    </Card>
  );
};

export default CardObject;
